package com.lg.jdbc.ui;

import java.util.Scanner;

public class Number {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
     int f,l;
     Scanner scan=new Scanner(System.in);
     f=scan.nextInt();
     l=scan.nextInt();
     while(f<=l) {
    	 int i=0;
    	 System.out.print(f+i);
    	 f++;
    	 i++;
    	 
     }
	}

}
